window.bookSummaryJSON = "<p>Lonnie Skyeborne always knew at least three things to be true:<br> <br> 1. She was human in a land of fairies.<br> <br> 2. She hated the royals above everyone else.<br> <br> 3. She was a liar.<br> <br> Except, ever since becoming the queen of Elsewhere, everything Lonnie knows to be true is crumbling around her. The castle has fallen, the crown has been stolen, and the kingdom of Elsewhere is overrun by rebels and monsters.<br> <br> It's a bad time to be a human in the country of Elsewhere . . . except that might no longer apply to Lonnie. While on the road to Aftermath, the human queen is finding it harder and harder to speak a falsehood . . . especially about whom she claims to hate.<br> <br> Contains mature themes.</p>"; 
